import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import classes from './css/ProductDetail.module.css';
import ApiService from '../../../../ApiService';

const ProductDetail = () => {
    const { productNum } = useParams();
    const navigate = useNavigate();
    const [product, setProduct] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchProductDetails = async () => {
            try {
                const response = await ApiService.fetchProductByNum(productNum);
                const data = response.data;
                setProduct(data);
            } catch (error) {
                console.error("Error fetching product details:", error);
            } finally {
                setLoading(false);
            }
        };

        fetchProductDetails();
    }, [productNum]);

    if (loading) {
        return <div>Loading...</div>;
    }

    if (!product) {
        return <div>상품을 찾을 수 없습니다.</div>;
    }

    const discountPercentage = Math.round(((product.oprice - product.rprice) / product.oprice) * 100);

    return (
        <div className={classes.productDetail}>
            {/* Header */}
            <header className={classes.header}>
                <button onClick={() => navigate('/prod-list')} className={classes.backButton}>목록으로 돌아가기</button>
            </header>

            {/* Image Carousel */}
            <div className={classes.imageCarousel}>
                {product.productImg.map((img, index) => (
                    <img key={index} src={img} alt={product.productName} className={classes.productImage} />
                ))}
            </div>

            {/* Product Info */}
            <div className={classes.productInfo}>
                <h1 className={classes.productName}>{product.productName}</h1>
                <a href="#reviews" className={classes.reviewLink}>리뷰 바로가기</a>
                <div className={classes.priceInfo}>
                    <span className={classes.originalPrice}>{product.oprice.toLocaleString()} 원</span>
                    <span className={classes.discountPrice}>{product.rprice.toLocaleString()} 원</span>
                    <span className={classes.discountPercentage}>({discountPercentage}% 할인)</span>
                </div>
            </div>

            {/* Navigation Bar */}
            <nav className={classes.navBar}>
                <a href="#productInfo">상품 정보</a>
                <a href="#reviews">리뷰</a>
                <a href="#recommendations">추천</a>
                <a href="#inquiries">문의</a>
            </nav>

            {/* Product Details */}
            <section id="productInfo" className={classes.productDetails}>
                <h2>상세 정보</h2>
                <ul>
                    {product.productDetails.map((detail, index) => (
                        <li key={index}>
                            <strong>사이즈:</strong> {detail.productSize}, 재고: {detail.productInven}개
                        </li>
                    ))}
                </ul>
            </section>

            {/* Reviews */}
            <section id="reviews" className={classes.reviews}>
                <h2>리뷰</h2>
                {product.reviews.length > 0 ? (
                    product.reviews.map((review) => (
                        <div key={review.reviewNum} className={classes.review}>
                            <h3>{review.reviewTitle}</h3>
                            <p>{review.reviewContent}</p>
                        </div>
                    ))
                ) : (
                    <p>아직 작성된 리뷰가 없습니다.</p>
                )}
            </section>

            {/* Footer */}
            <footer className={classes.footer}>
                <div className={classes.footerButtons}>
                    <button className={classes.favoriteButton}>관심상품 등록</button>
                    <button className={classes.purchaseButton}>구매하기</button>
                </div>
            </footer>
        </div>
    );
};

export default ProductDetail;
